</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="travailler-avec-php">### Travailler avec PHP</a>
</h1>
<div class="Section6"><br><b>PHP</b> est un langage de programmation orientée objet pour la conception de pages web dynamiques.<br><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="creer-un-projet-php">Créer un projet</a>
</h1>
<div class="Section6"><br><b>Prérequis :</b><br><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Installer WampServer.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Autoriser les machines virtuelles.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Configurer le numéro de port du serveur.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Configurer le répertoire racine du serveur.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Redémarrer WampServer.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Créer un fichier (index.php) dans le répertoire racine du serveur.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Editer le programme PHP dans le fichier (index.php).</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Ouvrir un navigateur web.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Accéder à la page web à l'adresse (http://localhost:8000/).</div>
</div><br><b>Attention :</b><br><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Le contenu de tout répertoire ne contenant pas de fichier (index.php) sera accessible depuis l'extérieur.&nbsp;</div>
</div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><span class="GText2" style="
color: #00ff00;
">// index.php (Programme principal)</span><br><pre class="GCode1 Code1 AceCode" data-mode="php" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
&lt;?php
echo sprintf("&lt;h1&gt;Bonjour tout le monde&lt;/h1&gt;");
...</pre><br><span class="GText2" style="
color: #00ff00;
">// Google Chrome (Exécuter le projet)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
http://localhost:8000/
...</pre><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="creer-une-fonction-php">Créer une fonction</a>
</h1>
<div class="Section6"><br>Une <b>fonction </b>est un bloc d'instructions destiné à réaliser une tâche bien précise.<br><br><span class="GText2" style="
color: #00ff00;
">// index.php (Programme principal)</span><br><pre class="GCode1 Code1 AceCode" data-mode="php" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
&lt;?php
function Hello_Run()
{
    echo sprintf("&lt;h1&gt;Bonjour tout le monde&lt;/h1&gt;");
}

Hello_Run();
...</pre><br><span class="GText2" style="
color: #00ff00;
">// Google Chrome (Exécuter le projet)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
http://localhost:8000/
...</pre><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="creer-un-module-php">Créer un module</a>
</h1>
<div class="Section6"><br>Un <b>module </b>est un ensemble de fonctionnalités réutilisable écrit dans un fichier séparé.<br><br><span class="GText2" style="
color: #00ff00;
">// index.php (Programme principal)</span><br><pre class="GCode1 Code1 AceCode" data-mode="php" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
&lt;?php
require "rdv_hello.php";
Hello_Run();
...</pre><br><span class="GText2" style="
color: #00ff00;
">// rdv_hello.php (Gestion du module)</span><br><pre class="GCode1 Code1 AceCode" data-mode="php" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
&lt;?php
function Hello_Run()
{
    echo sprintf("&lt;h1&gt;Bonjour tout le monde&lt;/h1&gt;");
}
...</pre><br><span class="GText2" style="
color: #00ff00;
">// Google Chrome (Exécuter le projet)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
http://localhost:8000/
...</pre><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="creer-une-classe-php">Créer une classe</a>
</h1>
<div class="Section6"><br>Une <b>classe </b>est une structure destinée à encapsuler les propriétés et les fonctionnalités associées à un objet.<br><br><span class="GText2" style="
color: #00ff00;
">// index.php (Programme principal)</span><br><pre class="GCode1 Code1 AceCode" data-mode="php" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
&lt;?php
require "cClass.php";
function run()
{
    $oClass = new cClass();
    $oClass-&gt;run();
}
run();
run();
...</pre><br><span class="GText2" style="
color: #00ff00;
">// cClass.php (Gestion de la classe)</span><br><pre class="GCode1 Code1 AceCode" data-mode="php" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
&lt;?php
class cClass
{
    public function __construct()
    {
        echo sprintf("Constructeur : %s&lt;br&gt;\n", "cClass.__construct()");
    }

    public function __destruct()
    {
        echo sprintf("Destructeur : %s&lt;br&gt;\n", "cClass.__destruct()");
    }

    public function run()
    {
        echo sprintf("Méthode : %s&lt;br&gt;\n", "cClass.run()");
    }
}
...</pre><br><span class="GText2" style="
color: #00ff00;
">// Google Chrome (Exécuter le projet)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
http://localhost:8000/
...</pre><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><b>Notes :</b><br><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Le destructeur de la classe en PHP ne peut pas être appelé directement à partir du code. Il est appelé implicitement par le Common Language Runtime (CLR) lorsque le Garbage Collector (GC) récupère l'objet et vérifie que l'objet n'a plus de référence dans le code ou que l'objet est sorti de sa portée.&nbsp;</div>
</div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="creer-un-chargeur-automatique-de-classes-php">Créer un chargeur automatique de classes</a>
</h1>
<div class="Section6"><br>Un <b>chargeur automatique</b> de classes est nécessaire lorsqu'on dispose de plusieurs classes afin d'éviter d'inclure manuellement une longue liste de classes au début de chaque script PHP.<br><br><span class="GText2" style="
color: #00ff00;
">// index.php (Programme principal)</span><br><pre class="GCode1 Code1 AceCode" data-mode="php" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
&lt;?php
require "rdv_autoload.php";
$oClass = new cClass();
$oClass-&gt;run();
...</pre><br><span class="GText2" style="
color: #00ff00;
">// cClass.php (Gestion de la classe)</span><br><pre class="GCode1 Code1 AceCode" data-mode="php" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
&lt;?php
class cClass
{
    public function __construct()
    {
        echo sprintf("Constructeur : %s&lt;br&gt;\n", "cClass.__construct()");
    }

    public function run()
    {
        echo sprintf("Méthode : %s&lt;br&gt;\n", "cClass.run()");
    }
}
...</pre><br><span class="GText2" style="
color: #00ff00;
">// rdv_autoload.php (Gestion du chargeur automatique)</span><br><pre class="GCode1 Code1 AceCode" data-mode="php" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
&lt;?php
function rdv_autoload($_classname)
{
    $classname = $_classname . ".php";
    echo sprintf("rdv_autoload : %s&lt;br&gt;\n", $classname);
    require $classname;
}

spl_autoload_register('rdv_autoload');
...</pre><br><span class="GText2" style="
color: #00ff00;
">// Google Chrome (Exécuter le projet)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
http://localhost:8000/
...</pre><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="creer-un-espace-de-noms-php">Créer un espace de noms</a>
</h1>
<div class="Section6"><br>Un <b>espace de noms</b> est un gestionnaire d'encapsulation. Il est nécessaire lorsqu'on dispose de plusieurs classes réparties dans différents répertoires afin de faciliter leur chargement automatique.<br><br><span class="GText2" style="
color: #00ff00;
">// index.php (Programme principal)</span><br><pre class="GCode1 Code1 AceCode" data-mode="php" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
&lt;?php
require "rdv_autoload.php";
$oClass = new cClass();
$oClass-&gt;run();
$oClass = new class\cClass();
$oClass-&gt;run();
...</pre><br><span class="GText2" style="
color: #00ff00;
">// cClass.php (Gestion de la classe)</span><br><pre class="GCode1 Code1 AceCode" data-mode="php" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
&lt;?php
class cClass
{
    public function __construct()
    {
        echo sprintf("Constructeur : %s&lt;br&gt;\n", "cClass.__construct()");
    }

    public function __destruct()
    {
        echo sprintf("Destructeur : %s&lt;br&gt;\n", "cClass.__destruct()");
    }

    public function run()
    {
        echo sprintf("Méthode : %s&lt;br&gt;\n", "cClass.run()");
    }
}
...</pre><br><span class="GText2" style="
color: #00ff00;
">// class\cClass.php (Gestion de l'espace de noms)</span><br><pre class="GCode1 Code1 AceCode" data-mode="php" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
&lt;?php

namespace class;

class cClass
{
    public function __construct()
    {
        echo sprintf("Constructeur (2) : %s&lt;br&gt;\n", "cClass.__construct()");
    }

    public function __destruct()
    {
        echo sprintf("Destructeur (2) : %s&lt;br&gt;\n", "cClass.__destruct()");
    }

    public function run()
    {
        echo sprintf("Méthode (2) : %s&lt;br&gt;\n", "cClass.run()");
    }
}
...</pre><br><span class="GText2" style="
color: #00ff00;
">// Google Chrome (Exécuter le projet)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
http://localhost:8000/
...</pre><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="passer-un-argument-par-reference-php">Passer un argument par référence</a>
</h1>
<div class="Section6"><br>Le <b>passage par référence</b> d'une variable en argument à une fonction permet de modifier la variable à l'intérieure de la fonction appelante.<br><br><span class="GText2" style="
color: #00ff00;
">// index.php (Programme principal)</span><br><pre class="GCode1 Code1 AceCode" data-mode="php" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
&lt;?php
require "rdv_autoload.php";
$oMessage = "Passer un argument : ";
$oClass = new cClass();
$oClass-&gt;run($oMessage);
echo $oMessage;
...</pre><br><span class="GText2" style="
color: #00ff00;
">// cClass.php (Gestion du passage par référence)</span><br><pre class="GCode1 Code1 AceCode" data-mode="php" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
&lt;?php
class cClass
{
    public function __construct() {}

    public function run(&amp;$_oMessage)
    {
        $_oMessage .= "Par référence";
    }
}
...</pre><br><span class="GText2" style="
color: #00ff00;
">// Google Chrome (Exécuter le projet)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
http://localhost:8000/
...
</pre><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="creer-la-structure-d-un-projet-html-php">Créer la structure d'un projet HTML</a>
</h1>
<div class="Section6"><br>La <b>structure d'un projet HTML</b> permet rajouter des informations supplémentaires à l'en-tête d'une page web. Elle permet d'attribuer entres autres un titre et un logo à la page web.<br><br><span class="GText2" style="
color: #00ff00;
">// index.php (Programme principal)</span><br><pre class="GCode1 Code1 AceCode" data-mode="php" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
&lt;?php
require "rdv_autoload.php";
$oPage = new app\cPage(
    "ReadyWEB",
    "/data/img/logo.png",
    "image/png",
    "fr",
    "UTF-8",
    "Bonjour tout le monde"
);
$oContent = "";
$oPage-&gt;run($oContent);
echo $oContent;
...</pre><br><span class="GText2" style="
color: #00ff00;
">// app\cPage.php (Gestion de la structure de la page)</span><br><pre class="GCode1 Code1 AceCode" data-mode="php" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
&lt;?php

namespace app;

class cPage
{
    private $m_title;
    private $m_logo;
    private $m_logoMimeType;
    private $m_lang;
    private $m_encoding;
    private $m_content;

    public function __construct($_title, $_logo, $_logoMimeType, $_lang, $_encoding, $_content)
    {
        $this-&gt;m_title = $_title;
        $this-&gt;m_logo = $_logo;
        $this-&gt;m_logoMimeType = $_logoMimeType;
        $this-&gt;m_lang = $_lang;
        $this-&gt;m_encoding = $_encoding;
        $this-&gt;m_content = $_content;
    }

    public function run(&amp;$_oContent)
    {
        $_oContent = "";
        $_oContent .= sprintf("&lt;!DOCTYPE html&gt;\n");
        $_oContent .= sprintf("&lt;html lang='%s'&gt;\n", $this-&gt;m_lang);
        $_oContent .= sprintf("&lt;head&gt;\n");
        $_oContent .= sprintf("&lt;title&gt;%s&lt;/title&gt;\n", $this-&gt;m_title);
        $_oContent .= sprintf("&lt;meta charset='%s'/&gt;\n", $this-&gt;m_encoding);
        $_oContent .= sprintf("&lt;link rel='shortcut icon' type='%s' href='%s'/&gt;\n", $this-&gt;m_logoMimeType, $this-&gt;m_logo);
        $_oContent .= sprintf("&lt;meta name='viewport' content='width=device-width, maximum-scale=1.0, minimum-scale=1.0, initial-scale=1.0, user-scalable=no'/&gt;\n");
        $_oContent .= sprintf("&lt;/head&gt;\n");
        $_oContent .= sprintf("&lt;body&gt;\n");
        $_oContent .= sprintf("%s\n", $this-&gt;m_content);
        $_oContent .= sprintf("&lt;/body&gt;\n");
        $_oContent .= sprintf("&lt;/html&gt;\n");
        return true;
    }
}
